import * as React from 'react';
import * as style from './button.scss';

export interface Props {
  type?: string;
}

const Button: React.SFC<Props> = ({ children, type }) => {
  const className = style.btn + (type === 'outlined' ? ` ${style.outlined}` : '');
  console.log(className);

  return <button className={className}>{children}</button>;
};

export default Button;
try {
    // @ts-ignore
    Button.displayName = "Button";
    // @ts-ignore
    Button.__docgenInfo = { "description": "", "displayName": "Button", "props": { "type": { "defaultValue": null, "description": "", "name": "type", "required": false, "type": { "name": "string" } } } };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/app/shared/ui-kit/Button/index.tsx#Button"] = { docgenInfo: Button.__docgenInfo, name: "Button", path: "src/app/shared/ui-kit/Button/index.tsx#Button" };
}
catch (__react_docgen_typescript_loader_error) { }
